INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ミッションをクリアして、\n報酬をゲットしましょう！", "2030/01/01 14:59:59", 0.0, "カリン", 1000002, -416.5, 1, 2, 2, 190801, "2025/01/31 12:00:00", 1, 3.099, 62);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("受け取ることができる\n報酬があるようです\n確認してみてください", "2030/01/01 14:59:59", 0.0, "カリン", 1000003, -416.5, 1, 3, 2, 190801, "2025/01/31 12:00:00", 1, 2.801, 63);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("報酬がもらえますよ！\nチェックしてみてください", "2030/01/01 14:59:59", 0.0, "カリン", 1000004, -416.5, 2, 4, 2, 190801, "2025/01/31 12:00:00", 1, 0.0, 63);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", 0.0, "カリン", 1000005, -363.0, 2, 5, 1, 190801, "2025/01/31 12:00:00", 1, 2.12, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2030/01/01 14:59:59", 0.0, "カリン", 1000006, -363.0, 1, 6, 2, 190801, "2025/01/31 12:00:00", 1, 1.68, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", 0.0, "カリン", 1000007, -363.0, 2, 7, 1, 190801, "2025/01/31 12:00:00", 1, 2.33, 64);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", -6.0, "ラビリスタ", 1020101, -285.0, 3, 101, 7, 133701, "2025/01/31 12:00:00", 10201, 5.18, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", -2.0, "クリスティーナ", 1020102, -285.0, 1, 201, 2, 133901, "2025/01/31 12:00:00", 10201, 8.77, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", 0.0, "ネネカ", 1020103, -285.0, 6, 301, 1, 133801, "2025/01/31 12:00:00", 10201, 15.5, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", 0.0, "ランファ", 1020201, -285.0, 2, 101, 5, 134301, "2025/02/28 12:00:00", 10202, 9.061, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", 0.0, "チカ", 1020202, -285.0, 1, 201, 2, 134401, "2025/02/28 12:00:00", 10202, 7.699, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", 0.0, "アオイ", 1020301, -285.0, 1, 101, 2, 134601, "2025/03/31 12:00:00", 10203, 8.595, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", 0.0, "クローチェ", 1020302, -285.0, 1, 201, 2, 134501, "2025/03/31 12:00:00", 10203, 7.758, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", 0.0, "ルイズマリー", 1020401, -285.0, 2, 101, 6, 132302, "2025/04/30 12:00:00", 10204, 7.0, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", 0.0, "イロハ", 1020402, -285.0, 1, 201, 2, 132402, "2025/04/30 12:00:00", 10204, 7.904, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", 0.0, "ソノ", 1020403, -285.0, 4, 301, 2, 132502, "2025/04/30 12:00:00", 10204, 8.487, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2030/01/01 14:59:59", 0.0, "カノン", 1020502, -285.0, 1, 101, 2, 134901, "2025/05/31 12:00:00", 10205, 8.763, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2030/01/01 14:59:59", 0.0, "ツムギ", 1020503, -285.0, 1, 201, 3, 134801, "2025/05/31 12:00:00", 10205, 6.417, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "2030/01/01 14:59:59", 0.0, "エリス", 1020601, -285.0, 3, 101, 7, 135001, "2025/06/30 12:00:00", 10206, 10.335, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "2030/01/01 14:59:59", 0.0, "シェフィ", 1020602, -285.0, 2, 201, 4, 135101, "2025/06/30 12:00:00", 10206, 6.281, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "2030/01/01 14:59:59", 0.0, "プレシア", 1020603, -285.0, 1, 301, 2, 135201, "2025/06/30 12:00:00", 10206, 12.244, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "2030/01/01 14:59:59", 0.0, "クリア", 1020701, -285.0, 2, 101, 8, 135301, "2025/07/31 12:00:00", 10207, 6.339, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "2030/01/01 14:59:59", 0.0, "アネモネ", 1020702, -285.0, 7, 201, 9, 135401, "2025/07/31 12:00:00", 10207, 8.184, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "2030/01/01 14:59:59", 0.0, "アイラ", 1020801, -285.0, 9, 101, 2, 129101, "2025/08/31 12:00:00", 10208, 3.906, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "2030/01/01 14:59:59", 0.0, "シナツ", 1020802, -285.0, 1, 201, 2, 129201, "2025/08/31 12:00:00", 10208, 14.465, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "2030/01/01 14:59:59", 0.0, "ヒヨリ", 1020803, -285.0, 4, 301, 3, 100101, "2025/08/31 12:00:00", 10208, 8.662, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "2030/01/01 14:59:59", 0.0, "レイ", 1020804, -285.0, 1, 401, 3, 100301, "2025/08/31 12:00:00", 10208, 10.915, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "2030/01/01 14:59:59", 0.0, "ユキノ", 1020901, -285.0, 1, 101, 7, 135802, "2025/09/30 12:00:00", 10209, 6.042, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "2030/01/01 14:59:59", 0.0, "サツキ", 1020902, -285.0, 4, 201, 1, 135903, "2025/09/30 12:00:00", 10209, 9.402, 61);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES ("う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "2030/01/01 14:59:59", 0.0, "ルルィ", 1020903, -285.0, 8, 301, 1, 136902, "2025/09/30 12:00:00", 10209, 8.16, 61);
